import React from 'react';

const Status = () => {
    const visioEmbedUrl = "https://merced-my.sharepoint.com/:u:/g/personal/ewaring_ucmerced_edu/ERn0jSqVt_hKpyyKxt_yJQgBjwbOjv6CvfJkkKS4_VJ81g?e=UbQmTc&CID=7c7e8603-e149-e9f6-9a08-049c1e887201"; // Update this with the correct URL

    return (
        <div>
      <h1>Embedded Visio File</h1>
      <iframe 
        src={visioEmbedUrl} 
        width="800" 
        height="600" 
        // frameBorder="0"
        title="Visio File"
      ></iframe>
    </div>
    );
}

// Define styles
const containerStyle = {
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    height: '600px',
};

const imageStyle = {
    width: '75%',
    height: '100%',
};
export default Status;
